import { NavLink } from 'react-router-dom';

const Home = () => {
  return (
    <>
      <div c>
        <NavLink activeClassName="menu_style" to="/"> AboutUs </NavLink>
        <NavLink activeClassName="active_class" to="/contact"> Contact </NavLink>
      </div>
    </>
  )
}

export default Home
